import React from "react";

//components
import Loading from "../components/Spinner";


//hooks
import { useHomeFetch } from "../hooks/getPokemonPage";

import { getPokemon } from "../Utility/getPokemon";

const Home = async () => {
    const { state, loading, error } = useHomeFetch();
    let cnt = 0;
    console.log(state);
    if (error) {
        return (
            <div>
                Something went Wrong :(
            </div>
        )
    }
    return (
        <>
            {

                state.pokemons.map(element => (
                    //{ const poke = getPokemon(element.name) }
                    <div >
                        {element.name + cnt}
                    </div>


                ))
            }

            {loading && <Loading />}
        </>
    )
}

export default Home;
